import React from 'react';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"
import Header from "./app/components/Header"
import AppBody from "./app/components/AppBody"


function App() {
  return (
    <div className="app">
      <Router>
        <>
          <Routes>
            <Route path="/" element={<Header/>}/>
            <AppBody/>
          </Routes>
        </>
      </Router>
    </div>
  );
}

export default App;
